import * as types from './../constants/ActionTypes'

var initialState = [
    {
        id: 1,
        name: 'Hoc Angular',
        status: true
    }
];

var myReducer = (state = initialState, action) => {
    switch (action.type) {
        case types.LIST_ALL:
            break;
        default:
            break;
    }
    return state;
};

export default myReducer;
